// src/components/Projects.js
import React from 'react';
import './Projects.css';

const Projects = () => {
  return (
    <div className="projects">
      <h1>Projects</h1>
      <section className="project">
        <img src="/OIP (1).jpg" alt="Project 1" />
        <h2>Project Title 1</h2>
        <p>Short description of the project, your role, and the outcome.</p>
      </section>
      <section className="project">
        <img src="/OIP.jpg" alt="Project 2" />
        <h2>Project Title 2</h2>
        <p>Short description of the project, your role, and the outcome.</p>
      </section>
      <section className="project">
        <img src="/OIP (2).jpg" alt="Project 3" />
        <h2>Project Title 3</h2>
        <p>Short description of the project, your role, and the outcome.</p>
      </section>
    </div>
  );
};

export default Projects;
